contracts/AIAssetNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract AIAssetNFT is ERC721, ERC721URIStorage, ERC721Enumerable, Ownable, Pausable, ReentrancyGuard {
    using Counters for Counters.Counter;
    
    Counters.Counter private _tokenIdCounter;
    
    // Asset types
    enum AssetType { MODEL, SCRIPT, DATASET }
    
    // Asset structure
    struct Asset {
        uint256 tokenId;
        AssetType assetType;
        string name;
        string description;
        string version;
        address creator;
        uint256 createdAt;
        uint256 updatedAt;
        string ipfsHash;
        bool isPublic;
        uint256 royaltyPercentage; // Basis points (100 = 1%)
        uint256 price; // In wei
        bool isForSale;
    }
    
    // Version history for each asset
    struct Version {
        string version;
        string ipfsHash;
        uint256 timestamp;
        string changelog;
    }
    
    // Mappings
    mapping(uint256 => Asset) public assets;
    mapping(uint256 => Version[]) public assetVersions;
    mapping(address => uint256[]) public creatorAssets;
    mapping(string => bool) public usedIPFSHashes;
    
    // Events
    event AssetMinted(
        uint256 indexed tokenId,
        address indexed creator,
        AssetType assetType,
        string name,
        string ipfsHash
    );
    
    event AssetUpdated(
        uint256 indexed tokenId,
        string newVersion,
        string newIPFSHash,
        string changelog
    );
    
    event AssetPriceUpdated(
        uint256 indexed tokenId,
        uint256 newPrice,
        bool isForSale
    );
    
    event AssetSold(
        uint256 indexed tokenId,
        address indexed seller,
        address indexed buyer,
        uint256 price
    );
    
    event RoyaltyPaid(
        uint256 indexed tokenId,
        address indexed creator,
        uint256 amount
    );
    
    constructor() ERC721("AI Asset NFT", "AIASSET") {}
    
    // Modifiers
    modifier onlyAssetOwner(uint256 tokenId) {
        require(ownerOf(tokenId) == msg.sender, "Not the asset owner");
        _;
    }
    
    modifier validAssetType(uint8 assetType) {
        require(assetType < 3, "Invalid asset type");
        _;
    }
    
    modifier validRoyaltyPercentage(uint256 royaltyPercentage) {
        require(royaltyPercentage <= 1000, "Royalty cannot exceed 10%");
        _;
    }
    
    // Mint new AI asset
    function mintAsset(
        AssetType assetType,
        string memory name,
        string memory description,
        string memory version,
        string memory ipfsHash,
        bool isPublic,
        uint256 royaltyPercentage,
        uint256 price,
        bool isForSale
    ) external whenNotPaused validAssetType(uint8(assetType)) validRoyaltyPercentage(royaltyPercentage) {
        require(bytes(ipfsHash).length > 0, "IPFS hash required");
        require(!usedIPFSHashes[ipfsHash], "IPFS hash already used");
        require(bytes(name).length > 0, "Name required");
        
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        
        _safeMint(msg.sender, tokenId);
        _setTokenURI(tokenId, ipfsHash);
        
        Asset memory newAsset = Asset({
            tokenId: tokenId,
            assetType: assetType,
            name: name,
            description: description,
            version: version,
            creator: msg.sender,
            createdAt: block.timestamp,
            updatedAt: block.timestamp,
            ipfsHash: ipfsHash,
            isPublic: isPublic,
            royaltyPercentage: royaltyPercentage,
            price: price,
            isForSale: isForSale
        });
        
        assets[tokenId] = newAsset;
        creatorAssets[msg.sender].push(tokenId);
        usedIPFSHashes[ipfsHash] = true;
        
        // Add initial version
        assetVersions[tokenId].push(Version({
            version: version,
            ipfsHash: ipfsHash,
            timestamp: block.timestamp,
            changelog: "Initial version"
        }));
        
        emit AssetMinted(tokenId, msg.sender, assetType, name, ipfsHash);
    }
    
    // Update asset with new version
    function updateAsset(
        uint256 tokenId,
        string memory newVersion,
        string memory newIPFSHash,
        string memory changelog
    ) external onlyAssetOwner(tokenId) whenNotPaused {
        require(bytes(newIPFSHash).length > 0, "IPFS hash required");
        require(!usedIPFSHashes[newIPFSHash], "IPFS hash already used");
        require(bytes(newVersion).length > 0, "Version required");
        
        Asset storage asset = assets[tokenId];
        asset.version = newVersion;
        asset.updatedAt = block.timestamp;
        asset.ipfsHash = newIPFSHash;
        
        _setTokenURI(tokenId, newIPFSHash);
        usedIPFSHashes[newIPFSHash] = true;
        
        // Add new version to history
        assetVersions[tokenId].push(Version({
            version: newVersion,
            ipfsHash: newIPFSHash,
            timestamp: block.timestamp,
            changelog: changelog
        }));
        
        emit AssetUpdated(tokenId, newVersion, newIPFSHash, changelog);
    }
    
    // Update asset price and sale status
    function updateAssetPrice(
        uint256 tokenId,
        uint256 newPrice,
        bool isForSale
    ) external onlyAssetOwner(tokenId) whenNotPaused {
        Asset storage asset = assets[tokenId];
        asset.price = newPrice;
        asset.isForSale = isForSale;
        
        emit AssetPriceUpdated(tokenId, newPrice, isForSale);
    }
    
    // Buy asset
    function buyAsset(uint256 tokenId) external payable nonReentrant whenNotPaused {
        Asset storage asset = assets[tokenId];
        require(asset.isForSale, "Asset not for sale");
        require(msg.value >= asset.price, "Insufficient payment");
        require(ownerOf(tokenId) != msg.sender, "Cannot buy own asset");
        
        address seller = ownerOf(tokenId);
        uint256 salePrice = asset.price;
        
        // Calculate royalty
        uint256 royaltyAmount = (salePrice * asset.royaltyPercentage) / 10000;
        uint256 sellerAmount = salePrice - royaltyAmount;
        
        // Transfer ownership
        _transfer(seller, msg.sender, tokenId);
        
        // Update asset
        asset.isForSale = false;
        asset.price = 0;
        
        // Transfer payments
        if (royaltyAmount > 0) {
            payable(asset.creator).transfer(royaltyAmount);
            emit RoyaltyPaid(tokenId, asset.creator, royaltyAmount);
        }
        
        payable(seller).transfer(sellerAmount);
        
        // Refund excess payment
        if (msg.value > salePrice) {
            payable(msg.sender).transfer(msg.value - salePrice);
        }
        
        emit AssetSold(tokenId, seller, msg.sender, salePrice);
    }
    
    // Get asset details
    function getAsset(uint256 tokenId) external view returns (Asset memory) {
        return assets[tokenId];
    }
    
    // Get asset versions
    function getAssetVersions(uint256 tokenId) external view returns (Version[] memory) {
        return assetVersions[tokenId];
    }
    
    // Get creator's assets
    function getCreatorAssets(address creator) external view returns (uint256[] memory) {
        return creatorAssets[creator];
    }
    
    // Get all assets (for marketplace)
    function getAllAssets() external view returns (Asset[] memory) {
        uint256 totalSupply = _tokenIdCounter.current();
        Asset[] memory allAssets = new Asset[](totalSupply);
        
        for (uint256 i = 0; i < totalSupply; i++) {
            allAssets[i] = assets[i];
        }
        
        return allAssets;
    }
    
    // Get assets for sale
    function getAssetsForSale() external view returns (Asset[] memory) {
        uint256 totalSupply = _tokenIdCounter.current();
        uint256 forSaleCount = 0;
        
        // Count assets for sale
        for (uint256 i = 0; i < totalSupply; i++) {
            if (assets[i].isForSale) {
                forSaleCount++;
            }
        }
        
        Asset[] memory forSaleAssets = new Asset[](forSaleCount);
        uint256 index = 0;
        
        for (uint256 i = 0; i < totalSupply; i++) {
            if (assets[i].isForSale) {
                forSaleAssets[index] = assets[i];
                index++;
            }
        }
        
        return forSaleAssets;
    }
    
    // Override required functions
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }
    
    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }
    
    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }
    
    function supportsInterface(bytes4 interfaceId) public view override(ERC721, ERC721Enumerable, ERC721URIStorage) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
    
    // Admin functions
    function pause() external onlyOwner {
        _pause();
    }
    
    function unpause() external onlyOwner {
        _unpause();
    }
    
    function withdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

contracts/LicenseManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract LicenseManager is Ownable, ReentrancyGuard, Pausable {
    
    // License types
    enum LicenseType { 
        COMMERCIAL,     // Full commercial use
        NON_COMMERCIAL, // Non-commercial use only
        RESEARCH,       // Research and educational use
        CUSTOM         // Custom terms
    }
    
    // License structure
    struct License {
        uint256 licenseId;
        uint256 assetTokenId;
        address licensor;
        address licensee;
        LicenseType licenseType;
        uint256 price;
        uint256 duration; // 0 = perpetual
        uint256 startTime;
        uint256 endTime;
        bool isActive;
        string terms; // Custom terms for CUSTOM license type
        uint256 createdAt;
    }
    
    // Usage tracking
    struct UsageRecord {
        uint256 licenseId;
        address user;
        uint256 timestamp;
        string action; // "download", "api_call", "modify", etc.
        string details;
    }
    
    // Mappings
    mapping(uint256 => License) public licenses;
    mapping(uint256 => UsageRecord[]) public licenseUsage;
    mapping(address => uint256[]) public userLicenses;
    mapping(address => uint256[]) public userIssuedLicenses;
    mapping(uint256 => bool) public assetLicensable; // Which assets can be licensed
    
    // Counters
    uint256 private _licenseIdCounter;
    
    // Events
    event LicenseCreated(
        uint256 indexed licenseId,
        uint256 indexed assetTokenId,
        address indexed licensor,
        address licensee,
        LicenseType licenseType,
        uint256 price
    );
    
    event LicenseActivated(
        uint256 indexed licenseId,
        address indexed licensee
    );
    
    event LicenseExpired(
        uint256 indexed licenseId
    );
    
    event UsageRecorded(
        uint256 indexed licenseId,
        address indexed user,
        string action
    );
    
    event AssetLicensabilityUpdated(
        uint256 indexed assetTokenId,
        bool licensable
    );
    
    // Modifiers
    modifier onlyLicenseOwner(uint256 licenseId) {
        require(licenses[licenseId].licensor == msg.sender, "Not the license owner");
        _;
    }
    
    modifier onlyLicensee(uint256 licenseId) {
        require(licenses[licenseId].licensee == msg.sender, "Not the licensee");
        _;
    }
    
    modifier validLicense(uint256 licenseId) {
        require(licenses[licenseId].licenseId != 0, "License does not exist");
        _;
    }
    
    modifier activeLicense(uint256 licenseId) {
        require(licenses[licenseId].isActive, "License not active");
        require(
            licenses[licenseId].endTime == 0 || block.timestamp <= licenses[licenseId].endTime,
            "License expired"
        );
        _;
    }
    
    // Create a new license
    function createLicense(
        uint256 assetTokenId,
        address licensee,
        LicenseType licenseType,
        uint256 price,
        uint256 duration,
        string memory terms
    ) external payable whenNotPaused nonReentrant {
        require(assetLicensable[assetTokenId], "Asset not licensable");
        require(licensee != address(0), "Invalid licensee");
        require(licensee != msg.sender, "Cannot license to self");
        require(msg.value >= price, "Insufficient payment");
        
        uint256 licenseId = _licenseIdCounter;
        _licenseIdCounter++;
        
        uint256 startTime = block.timestamp;
        uint256 endTime = duration > 0 ? startTime + duration : 0;
        
        License memory newLicense = License({
            licenseId: licenseId,
            assetTokenId: assetTokenId,
            licensor: msg.sender,
            licensee: licensee,
            licenseType: licenseType,
            price: price,
            duration: duration,
            startTime: startTime,
            endTime: endTime,
            isActive: true,
            terms: terms,
            createdAt: block.timestamp
        });
        
        licenses[licenseId] = newLicense;
        userLicenses[licensee].push(licenseId);
        userIssuedLicenses[msg.sender].push(licenseId);
        
        // Transfer payment to licensor
        if (price > 0) {
            payable(msg.sender).transfer(price);
        }
        
        // Refund excess payment
        if (msg.value > price) {
            payable(msg.sender).transfer(msg.value - price);
        }
        
        emit LicenseCreated(licenseId, assetTokenId, msg.sender, licensee, licenseType, price);
        emit LicenseActivated(licenseId, licensee);
    }
    
    // Record usage of a licensed asset
    function recordUsage(
        uint256 licenseId,
        string memory action,
        string memory details
    ) external validLicense(licenseId) activeLicense(licenseId) onlyLicensee(licenseId) {
        UsageRecord memory usage = UsageRecord({
            licenseId: licenseId,
            user: msg.sender,
            timestamp: block.timestamp,
            action: action,
            details: details
        });
        
        licenseUsage[licenseId].push(usage);
        
        emit UsageRecorded(licenseId, msg.sender, action);
    }
    
    // Check if user has valid license for asset
    function hasValidLicense(address user, uint256 assetTokenId) external view returns (bool) {
        uint256[] memory userLicenseIds = userLicenses[user];
        
        for (uint256 i = 0; i < userLicenseIds.length; i++) {
            License memory license = licenses[userLicenseIds[i]];
            if (license.assetTokenId == assetTokenId && 
                license.isActive && 
                (license.endTime == 0 || block.timestamp <= license.endTime)) {
                return true;
            }
        }
        
        return false;
    }
    
    // Get user's licenses
    function getUserLicenses(address user) external view returns (License[] memory) {
        uint256[] memory licenseIds = userLicenses[user];
        License[] memory userLicenseList = new License[](licenseIds.length);
        
        for (uint256 i = 0; i < licenseIds.length; i++) {
            userLicenseList[i] = licenses[licenseIds[i]];
        }
        
        return userLicenseList;
    }
    
    // Get licenses issued by user
    function getIssuedLicenses(address user) external view returns (License[] memory) {
        uint256[] memory licenseIds = userIssuedLicenses[user];
        License[] memory issuedLicenseList = new License[](licenseIds.length);
        
        for (uint256 i = 0; i < licenseIds.length; i++) {
            issuedLicenseList[i] = licenses[licenseIds[i]];
        }
        
        return issuedLicenseList;
    }
    
    // Get license usage history
    function getLicenseUsage(uint256 licenseId) external view returns (UsageRecord[] memory) {
        return licenseUsage[licenseId];
    }
    
    // Deactivate license
    function deactivateLicense(uint256 licenseId) external validLicense(licenseId) onlyLicenseOwner(licenseId) {
        licenses[licenseId].isActive = false;
        emit LicenseExpired(licenseId);
    }
    
    // Set asset licensability
    function setAssetLicensability(uint256 assetTokenId, bool licensable) external onlyOwner {
        assetLicensable[assetTokenId] = licensable;
        emit AssetLicensabilityUpdated(assetTokenId, licensable);
    }
    
    // Batch set asset licensability
    function batchSetAssetLicensability(
        uint256[] memory assetTokenIds,
        bool[] memory licensableStatuses
    ) external onlyOwner {
        require(assetTokenIds.length == licensableStatuses.length, "Arrays length mismatch");
        
        for (uint256 i = 0; i < assetTokenIds.length; i++) {
            assetLicensable[assetTokenIds[i]] = licensableStatuses[i];
            emit AssetLicensabilityUpdated(assetTokenIds[i], licensableStatuses[i]);
        }
    }
    
    // Get license details
    function getLicense(uint256 licenseId) external view validLicense(licenseId) returns (License memory) {
        return licenses[licenseId];
    }
    
    // Check if license is expired
    function isLicenseExpired(uint256 licenseId) external view validLicense(licenseId) returns (bool) {
        License memory license = licenses[licenseId];
        return !license.isActive || (license.endTime > 0 && block.timestamp > license.endTime);
    }
    
    // Admin functions
    function pause() external onlyOwner {
        _pause();
    }
    
    function unpause() external onlyOwner {
        _unpause();
    }
    
    function withdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

contracts/Marketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "./AIAssetNFT.sol";
import "./LicenseManager.sol";

contract Marketplace is Ownable, ReentrancyGuard, Pausable {
    
    // Marketplace fee (basis points, 250 = 2.5%)
    uint256 public marketplaceFee = 250;
    uint256 public constant MAX_FEE = 1000; // 10% max
    
    // Referenced contracts
    AIAssetNFT public aiAssetNFT;
    LicenseManager public licenseManager;
    
    // Order structure for auction/bidding
    struct Order {
        uint256 orderId;
        uint256 assetTokenId;
        address seller;
        address buyer;
        uint256 price;
        uint256 startTime;
        uint256 endTime;
        bool isActive;
        bool isAuction;
        uint256 highestBid;
        address highestBidder;
    }
    
    // Bid structure
    struct Bid {
        address bidder;
        uint256 amount;
        uint256 timestamp;
    }
    
    // Mappings
    mapping(uint256 => Order) public orders;
    mapping(uint256 => Bid[]) public orderBids;
    mapping(address => uint256[]) public userOrders;
    mapping(address => uint256[]) public userBids;
    
    // Counters
    uint256 private _orderIdCounter;
    
    // Events
    event OrderCreated(
        uint256 indexed orderId,
        uint256 indexed assetTokenId,
        address indexed seller,
        uint256 price,
        bool isAuction,
        uint256 endTime
    );
    
    event OrderCancelled(
        uint256 indexed orderId,
        address indexed seller
    );
    
    event OrderFilled(
        uint256 indexed orderId,
        address indexed buyer,
        uint256 price
    );
    
    event BidPlaced(
        uint256 indexed orderId,
        address indexed bidder,
        uint256 amount
    );
    
    event BidWithdrawn(
        uint256 indexed orderId,
        address indexed bidder,
        uint256 amount
    );
    
    event AuctionEnded(
        uint256 indexed orderId,
        address indexed winner,
        uint256 winningBid
    );
    
    event MarketplaceFeeUpdated(
        uint256 newFee
    );
    
    // Modifiers
    modifier onlyAssetOwner(uint256 assetTokenId) {
        require(aiAssetNFT.ownerOf(assetTokenId) == msg.sender, "Not the asset owner");
        _;
    }
    
    modifier validOrder(uint256 orderId) {
        require(orders[orderId].orderId != 0, "Order does not exist");
        _;
    }
    
    modifier activeOrder(uint256 orderId) {
        require(orders[orderId].isActive, "Order not active");
        require(block.timestamp <= orders[orderId].endTime, "Order expired");
        _;
    }
    
    constructor(address _aiAssetNFT, address _licenseManager) {
        aiAssetNFT = AIAssetNFT(_aiAssetNFT);
        licenseManager = LicenseManager(_licenseManager);
    }
    
    // Create a fixed price order
    function createFixedPriceOrder(
        uint256 assetTokenId,
        uint256 price
    ) external onlyAssetOwner(assetTokenId) whenNotPaused {
        require(price > 0, "Price must be greater than 0");
        
        uint256 orderId = _orderIdCounter;
        _orderIdCounter++;
        
        Order memory newOrder = Order({
            orderId: orderId,
            assetTokenId: assetTokenId,
            seller: msg.sender,
            buyer: address(0),
            price: price,
            startTime: block.timestamp,
            endTime: 0, // No end time for fixed price
            isActive: true,
            isAuction: false,
            highestBid: 0,
            highestBidder: address(0)
        });
        
        orders[orderId] = newOrder;
        userOrders[msg.sender].push(orderId);
        
        emit OrderCreated(orderId, assetTokenId, msg.sender, price, false, 0);
    }
    
    // Create an auction order
    function createAuctionOrder(
        uint256 assetTokenId,
        uint256 startingPrice,
        uint256 duration
    ) external onlyAssetOwner(assetTokenId) whenNotPaused {
        require(startingPrice > 0, "Starting price must be greater than 0");
        require(duration > 0, "Duration must be greater than 0");
        
        uint256 orderId = _orderIdCounter;
        _orderIdCounter++;
        
        Order memory newOrder = Order({
            orderId: orderId,
            assetTokenId: assetTokenId,
            seller: msg.sender,
            buyer: address(0),
            price: startingPrice,
            startTime: block.timestamp,
            endTime: block.timestamp + duration,
            isActive: true,
            isAuction: true,
            highestBid: 0,
            highestBidder: address(0)
        });
        
        orders[orderId] = newOrder;
        userOrders[msg.sender].push(orderId);
        
        emit OrderCreated(orderId, assetTokenId, msg.sender, startingPrice, true, block.timestamp + duration);
    }
    
    // Buy fixed price order
    function buyFixedPriceOrder(uint256 orderId) external payable validOrder(orderId) activeOrder(orderId) nonReentrant {
        Order storage order = orders[orderId];
        require(!order.isAuction, "This is an auction order");
        require(msg.value >= order.price, "Insufficient payment");
        require(order.seller != msg.sender, "Cannot buy own order");
        
        // Execute the sale
        _executeSale(orderId, msg.sender, order.price);
        
        emit OrderFilled(orderId, msg.sender, order.price);
    }
    
    // Place bid on auction
    function placeBid(uint256 orderId) external payable validOrder(orderId) activeOrder(orderId) nonReentrant {
        Order storage order = orders[orderId];
        require(order.isAuction, "This is not an auction order");
        require(msg.sender != order.seller, "Cannot bid on own auction");
        require(msg.value > order.highestBid, "Bid must be higher than current highest bid");
        require(msg.value >= order.price, "Bid must be at least the starting price");
        
        // Refund previous highest bidder
        if (order.highestBidder != address(0)) {
            payable(order.highestBidder).transfer(order.highestBid);
        }
        
        // Update order with new highest bid
        order.highestBid = msg.value;
        order.highestBidder = msg.sender;
        
        // Record bid
        Bid memory newBid = Bid({
            bidder: msg.sender,
            amount: msg.value,
            timestamp: block.timestamp
        });
        
        orderBids[orderId].push(newBid);
        userBids[msg.sender].push(orderId);
        
        emit BidPlaced(orderId, msg.sender, msg.value);
    }
    
    // Withdraw bid (only if not the highest bidder)
    function withdrawBid(uint256 orderId) external validOrder(orderId) nonReentrant {
        Order storage order = orders[orderId];
        require(order.isAuction, "This is not an auction order");
        require(order.highestBidder != msg.sender, "Cannot withdraw highest bid");
        
        // Find user's bid amount
        uint256 bidAmount = 0;
        for (uint256 i = 0; i < orderBids[orderId].length; i++) {
            if (orderBids[orderId][i].bidder == msg.sender) {
                bidAmount = orderBids[orderId][i].amount;
                break;
            }
        }
        
        require(bidAmount > 0, "No bid found");
        
        // Refund the bid
        payable(msg.sender).transfer(bidAmount);
        
        emit BidWithdrawn(orderId, msg.sender, bidAmount);
    }
    
    // End auction and execute sale
    function endAuction(uint256 orderId) external validOrder(orderId) nonReentrant {
        Order storage order = orders[orderId];
        require(order.isAuction, "This is not an auction order");
        require(block.timestamp >= order.endTime, "Auction not ended yet");
        require(order.isActive, "Auction already ended");
        require(order.highestBidder != address(0), "No bids placed");
        
        // Execute the sale
        _executeSale(orderId, order.highestBidder, order.highestBid);
        
        emit AuctionEnded(orderId, order.highestBidder, order.highestBid);
    }
    
    // Cancel order
    function cancelOrder(uint256 orderId) external validOrder(orderId) {
        Order storage order = orders[orderId];
        require(order.seller == msg.sender, "Not the order owner");
        require(order.isActive, "Order not active");
        require(order.buyer == address(0), "Order already sold");
        
        // If it's an auction with bids, refund the highest bidder
        if (order.isAuction && order.highestBidder != address(0)) {
            payable(order.highestBidder).transfer(order.highestBid);
        }
        
        order.isActive = false;
        
        emit OrderCancelled(orderId, msg.sender);
    }
    
    // Internal function to execute sale
    function _executeSale(uint256 orderId, address buyer, uint256 price) internal {
        Order storage order = orders[orderId];
        
        // Get asset details
        AIAssetNFT.Asset memory asset = aiAssetNFT.getAsset(order.assetTokenId);
        
        // Calculate fees
        uint256 marketplaceFeeAmount = (price * marketplaceFee) / 10000;
        uint256 royaltyAmount = (price * asset.royaltyPercentage) / 10000;
        uint256 sellerAmount = price - marketplaceFeeAmount - royaltyAmount;
        
        // Transfer asset ownership
        aiAssetNFT.transferFrom(order.seller, buyer, order.assetTokenId);
        
        // Update order
        order.buyer = buyer;
        order.isActive = false;
        
        // Transfer payments
        if (royaltyAmount > 0) {
            payable(asset.creator).transfer(royaltyAmount);
        }
        
        payable(order.seller).transfer(sellerAmount);
        
        // Marketplace fee goes to contract owner
        if (marketplaceFeeAmount > 0) {
            payable(owner()).transfer(marketplaceFeeAmount);
        }
    }
    
    // Get order details
    function getOrder(uint256 orderId) external view validOrder(orderId) returns (Order memory) {
        return orders[orderId];
    }
    
    // Get order bids
    function getOrderBids(uint256 orderId) external view validOrder(orderId) returns (Bid[] memory) {
        return orderBids[orderId];
    }
    
    // Get user's orders
    function getUserOrders(address user) external view returns (Order[] memory) {
        uint256[] memory orderIds = userOrders[user];
        Order[] memory userOrderList = new Order[](orderIds.length);
        
        for (uint256 i = 0; i < orderIds.length; i++) {
            userOrderList[i] = orders[orderIds[i]];
        }
        
        return userOrderList;
    }
    
    // Get user's bids
    function getUserBids(address user) external view returns (Order[] memory) {
        uint256[] memory bidOrderIds = userBids[user];
        Order[] memory userBidList = new Order[](bidOrderIds.length);
        
        for (uint256 i = 0; i < bidOrderIds.length; i++) {
            userBidList[i] = orders[bidOrderIds[i]];
        }
        
        return userBidList;
    }
    
    // Get active orders
    function getActiveOrders() external view returns (Order[] memory) {
        uint256 totalOrders = _orderIdCounter;
        uint256 activeCount = 0;
        
        // Count active orders
        for (uint256 i = 0; i < totalOrders; i++) {
            if (orders[i].isActive && block.timestamp <= orders[i].endTime) {
                activeCount++;
            }
        }
        
        Order[] memory activeOrderList = new Order[](activeCount);
        uint256 index = 0;
        
        for (uint256 i = 0; i < totalOrders; i++) {
            if (orders[i].isActive && block.timestamp <= orders[i].endTime) {
                activeOrderList[index] = orders[i];
                index++;
            }
        }
        
        return activeOrderList;
    }
    
    // Admin functions
    function setMarketplaceFee(uint256 newFee) external onlyOwner {
        require(newFee <= MAX_FEE, "Fee too high");
        marketplaceFee = newFee;
        emit MarketplaceFeeUpdated(newFee);
    }
    
    function pause() external onlyOwner {
        _pause();
    }
    
    function unpause() external onlyOwner {
        _unpause();
    }
    
    function withdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

